import React from 'react'
import '../../css/pages/signupsignin.css'
import '../../css/reusables/positions.css'
import axios from 'axios';
import { useNavigate } from 'react-router';

function Admin()  {

  const [reportDates, setReportDates] = useState({ startDate: '', endDate: '' });

    const navigator = useNavigate()

    const changeHandler = (event) => {
    const name = event.target.name;
    const value = event.target.value;
    const tempReportDates = { ...props.reportDates};
    values [name] = value;

    props.setReportDates(tempReportDates)
  }

  const reportSubmitHandler = () => {
    axios.post("http://localhost:8080/cars/findCarsSold/{reportDates.startDate}/{reportDates.endDate}")
      .then((response) => {
        let text = response
        const obj = JSON.parse(text);
        navigator("/")
      })
      .catch((e) => {
        console.log(e)
      })

    }

    const signInSubmitHandler = () => {
        axios.post("http://localhost:8080/user/signIn", props.user)
          .then((response) => {
            localStorage.setItem("usernameCookie", response.data.username)
            props.setUser(response.data)
            navigator("/")
          })
          .catch((e) => {
            console.log(e)
          })

        }


    return (
        <div className='signup-signin-content'>
            <div className='sign-up-box'>
                <div>
                    Hello Dealer
                </div>
                <h1>Run Report</h1>
                <div className='flex-row justify-content-left'>
                    Report Start Date
                    <input className='input-container'  value={startDate} name='startDate' type='startDate' onChange={changeHandler} required></input>
                </div>
                <div className='-row justify-content-left'>
                    Report End Date
                    <input className='input-container' value={endDate} name='endDate' type='endDate' onChange={changeHandler} required></input>
                </div>
                <div className='flex-row justify-content-center'>
                    <button onClick={reportSubmitHandler}>SUBMIT</button>
                </div>
            </div>
            <div className='sign-up-box'>
                <div>Already A User?</div>
                <h1>Sign-In</h1>
                <div className='flex-row justify-content-left'>
                    USERNAME
                    <input className='input-container'  value={props.user.email} name='username' type='username' onChange={changeHandler} required></input>
                </div>
                <div className='flex-row justify-content-left'>
                    PASSWORD
                    <input className='input-container' value={props.user.password} name='password' type='password' onChange={changeHandler} required></input>
                </div>
                <div className='flex-row justify-content-center'>
                    <button onClick={signInSubmitHandler}>SUBMIT</button>
                </div>
            </div>

        </div>
    )
}


export default Admin
